import React from 'react';
import ReactDom from 'react-dom';

function MyInfo(){
  return (
    <div>
      <h1>Hello I am Chikki</h1>
      <p>I am learning Reactjs</p>
      <ul>
        <li>Japan</li>
        <li>Tokyo</li>
      </ul>
    </div>
    )
}
ReactDom.render(<MyInfo />,document.getElementById('root'));
